import image1 from './assets/index.jpeg';
import image2 from './assets/index1.jpeg';
import image3 from './assets/index2.jpeg';
import image4 from './assets/index3.jpeg';
function Cards() {
    return(
        <div className = "Cards">
            <div className = "App">
 <AliceCarousel autoPlay autoPlayInterval="3000">
      <img src={image1} className="sliderimg"/>
      <img src={image2} className="sliderimg"/>
      <img src={image3} className="sliderimg"/>
      <img src={image4} className="sliderimg"/>
</AliceCarousel>
   </div> 
        </div>
    )

}
export default Cards;
